const App = () => {
    const [
        type,
        setType
    ] = useState();

    const [
        rawInput,
        setRawInput
    ] = useState();

    const onFileChange = useCallback((e) => {
        e.preventDefault()
        const reader = new FileReader();
        reader.onload = async (e) => { 
          const text = e.target.result;
          setRawInput(text);
        };
        reader.readAsText(e.target.files[0]);
    }, []);

    const onTypeChange = useCallback((e) => {
        setRawInput('');
        setType(e.target.value);
    });

    const titleStyle = {
        fontSize: "32px",
        fontFamily: "Helvetica",
        marginBottom: "16px"
    };

    const flexColumnStyle = {
        display: "flex",
        flexDirection: "column",
    };

    const validationTypeStyle = {
        fontWeight: "bold"
    };

    const renderValidationMemo = useMemo(() => renderValidation(rawInput, type), [rawInput, type]);

    return (
        <div>
            <h1 style={titleStyle}>Dem Output Validatorr!</h1>
            <div style={flexColumnStyle}>
                <span style={validationTypeStyle}>Validation Type:</span>
                <div style={flexColumnStyle}>
                    <label>
                        Test: <input type="radio" name="type" value="test" onChange={onTypeChange} />
                    </label>
                    <label>
                        Submit: <input type="radio" name="type" value="submit" onChange={onTypeChange} />
                    </label>
                </div>
                <input type="file" name="file" onChange={onFileChange} />
            </div>
            {renderValidationMemo}
        </div>
    );
};

const renderValidation = (input, type) => {
    const preStyle = {
        padding: "16px",
        backgroundColor: "#14171a"
    }

    const inputLines = input && input.split("\n");
    const validInputLines = validRawInputs[type] && validRawInputs[type].split("\n");

    return type && inputLines && validInputLines && (
        <pre style={preStyle}>
            {validInputLines.map((validLine, index) => {
                const line = inputLines[index];
                const isValid = validLine === line;

                const pStyle = {
                    color: isValid ? "green" : "red",
                    lineHeight: "24px",
                    fontWeight: "medium"
                };

                return line && validLine && (
                    <div style={pStyle}>{`[${isValid ? "OK" : "KO"}] -- ${line}`}</div>
                )
            })}
        </pre>
    );
};

